import React from "react";

function Header() {
  return (
    <header style={headerStyle}>
      <h1> To Do List</h1>
    </header>
  );
}

const headerStyle = {
  backgroundColor: "#000000",
  color: "#fff",
  padding: "10px",
  textAlign: "center",
};

export default Header;
